webpackJsonp([1150],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-standard-objects-string-string-fromcharcode.json":function(e,r){e.exports={data:{markdownRemark:{html:'<p>The static <code>String.fromCharCode()</code> method returns a string created by using the specified sequence of Unicode values.</p>\n<h2>Syntax</h2>\n<pre><code>String.fromCharCode(num1[, ...[, numN]])\n</code></pre>\n<h3>Parameters</h3>\n<p><strong>num1, ..., numN</strong></p>\n<p>A sequence of numbers that are Unicode values.</p>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/fromCharCode">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/LIBRary/wb4w0k66(v=vs.94).aspx">MSDN link</a></p>\n<h2>Description</h2>\n<p>This method returns a string and not a String object.</p>\n<p>Because <code>fromCharCode()</code> is a static method of String, you always use it as <code>String.fromCharCode()</code>, rather than as a method of a String object you created.</p>\n<h2>Examples</h2>\n<pre><code>String.fromCharCode(65, 66, 67);  // "ABC"\n\nvar test = String.fromCharCode(112, 108, 97, 105, 110);\ndocument.write(test);\n\n// Output: plain\n</code></pre>',frontmatter:{title:"String fromCharCode",parent:"/home/stuart/guides/src/pages/articles/javascript/standard-objects/string/string-fromcharcode/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/standard-objects/string/string-fromcharcode/"}}}});
